import ReactDOM from 'react-dom'
import React from 'react'
import './index.css'
import Hamburger from './hamburger-menu-white.svg'

function NavbarPlaceholder() {
    return (
        <span class="navbar-child">
            Placeholder
        </span>
    )
}

function NavbarButton() {
    return (
        <span class="navbar-child" id="hamburger-span">
            <button id="button">
            </button>
        </span>
    )
}

function NavbarTitle() {
    return (
        <span class="navbar-child">
            Museum
        </span>
    )
}

function Navbar() {
    return (
        <div class="navbar-main navbar-position">
            <NavbarButton />
            <NavbarTitle />
            <NavbarPlaceholder />
        </div>
    )
}

function Page() {
    return (
        <Navbar />
    )
}

ReactDOM.render(
    <Page />,
    document.getElementById('root')
);
